import React from 'react'
import './Contact.css'
import { Component } from 'react';
import {Map, InfoWindow, Marker, GoogleApiWrapper} from 'google-maps-react';


class ContactComp extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isGoing: true,
      numberOfGuests: 2
    };

    this.handleInputChange = this.handleInputChange.bind(this);
  }

  handleInputChange(event) {
    const target = event.target;
    const value = target.type === 'checkbox' ? target.checked : target.value;
    const name = target.name;

    this.setState({
      [name]: value
    });
  }
    render(){
  return (
    <div>
      <div className='aboutContainer'>
        <div className='heading'>
            <h2>Contact</h2>
            <hr></hr>
            <p className='contactDes'>Lorem ipsum dolor sit amet consectetur adipisicing elit. Non quasi tempore quam veniam omnis, ad incidunt! 
                Vero aliquid adipisci quod voluptate aperiam rem quo quam, fugiat, officia asperiores dolores nam.Lorem ipsum dolor sit amet 
                consectetur adipisicing elit. Non quasi tempore quam veniam omnis, ad incidunt! 
                Vero aliquid adipisci quod voluptate aperiam rem quo quam, fugiat, officia asperiores dolores nam.</p>
                {/*Google map*/}
                <div className='map'>
                  <Map google={this.props.google}
                      style={{width: '60%', height: '30%'}}
                      className={'map'}
                      zoom={2}>
                    <Marker
                      title={'Sri lanka'}
                      name={'Jaffna'}
                      position={{lat: 9.657901, lng: 80.164307}} />
                  </Map>
                </div>
                {/*Google map end*/}
                <div className='contactSection'>
                      <div class="social-iconsCon">
                        <div className='icon1'>
                            <p><img src='././assets/location.png' class="location"></img></p>
                            <p>Location:</p>
                        </div>
                        <p className='eaddress'> Sivan kovil road, maddvuvil north, Chavakachcheri.</p>

                        <div className='icon1'>
                            <p><img src='././assets/email.png' class="email"></img></p>
                            <p>Email:</p>
                        </div>
                        <p className='eaddress'>t.kasthury66@gmail.com</p>

                        <div className='icon1'>
                            <p><img src='././assets/call.png' class="call"></img></p>
                            <p>Call:</p>
                        </div>
                        <p className='eaddress'>+94762875555</p>
                      </div>

                      <div className='form'>
                          <form>
                              <div className='contactFirst'>
                              <label>
          Number of guests:
          <input
            name="numberOfGuests"
            type="number"
            value={this.state.numberOfGuests}
            onChange={this.handleInputChange} />
        </label>
                                <input type="text" placeholder='Your Name' name="name" />
                                <input type="text" placeholder='Your Email' name="email" />
                              </div>
                              <div className='contactSecond'>
                                <input type="text" placeholder='Subject' name="subject" />
                              </div>
                              <div className='contactThird'>
                                <textarea>
                                      Message
                                </textarea>
                              </div>
                              <input type="submit" value="Send Message" className='submitButton'/>
                          </form>
                    </div>  
                </div>
        </div>
     </div>
    </div>
  )
}
}

export default GoogleApiWrapper({
    apiKey:"AIzaSyCih_O_RigdLPWzP0MADYbVRtoWfDLe_ys"
})(ContactComp)
